import React from 'react';
import { useRouter } from 'next/router';
import { useDispatch, useSelector } from "react-redux";
import { getPostsById } from "../../../src/redux/actions/actions"
import {state} from "../../../src/redux/reducers/reducer"

export default () => {
    const dispatch = useDispatch();
    const router = useRouter();
    const { postId } = router.query;

    React.useEffect(() => {
        getPostsById(postId, dispatch)
    }, [postId]);

    const { post, edit } = useSelector((state: state) => { return { post: state.post, edit: state.edit } });

    return (
        <h2>Hello world</h2>
    )
}
